import './Service.css';
import axios from 'axios';
import Board_header from "./../Board_header/Board_header";
import Board_list from "./../Board_list/Board_list.js";
function Service_Total(){
    const ApplyService = (e) => {
        axios({
            method: "post",
            url: "http://localhost:8080/api/v1/services/education",
            headers: {
                "Content-Type": "application/json",
                Authorization: "Bearer " + localStorage.getItem('token')
            },
            data: {
                "businessType": "TRANSLATE",
                "content": "안녕하세요. \n저는 컴퓨터과학과 20학번 이혜린입니다.\n다름이 아니라 케어풀리라는 팀은\n어떤 사람들로 구성되어 있고, 어느 곳에서 이런 팀이 만들어진 것이 궁금하여 문의를 드리게 되었습니다!",
                "requestDate": "2022-11-30",
                "requestTime": "18:34:22"
            }
        }).then((res) => {
            alert('서비스가 신청되었습니다.');
        }).catch((error) => {
            alert("어쩌지이... ? 안 뜨는데에..");
        });
    }
    return(
        <div>
            <Board_header t1="번호" t2="제목" t3="글쓴이" />
            <ul>
                {content===Object(content)
                    ? content.content.map((content, index) => (
                        <li key={index}>
                            <Board_list num={index+1} title={content.title} name={content.writer} />
                        </li>
                    ))
                    : "등록된 글이 없습니다"}
            </ul>
        </div>
    );
}

export default Service_Total;
